  def get_winner_and_colors(self):
    self.player_colors = {}
    colors = ['red', 'blue', 'yellow', 'green']
    for idx, player in enumerate(self.parsed_result['players'].values()):
      self.player_colors[player['name']] = colors[idx]
      if player['is_winner']:
        self.winner_name = player['name']

  def run(self):
    report = "<head>"
    report += "<meta charset='UTF-8'>"
    report += self.bootstrap_header()
    report += self.get_style()
    report += "</head>"
    #report += "<h1>SERVER: #{@parser.host}</h1>"
    #report += "<h1>MAP: #{@parser.currentMap}</h1>"
    report += "<div id='container'>"
    # report += self.server_info()
    # report += self.winner_info()
    report += self.game_summary()
    report += self.build_orders()
    # report += table(agatha_team, "agatha")
    # report += winner_info
    report += self.export_battles()
    # export

    git_path = '/Users/abazov/workspace/unknown/sc2/sc2pages'
    html_file = open(f"{git_path}/report.html", 'w')
    html_file.write(report)
    self.export_to_git_pages()

    # pdfkit.from_file('./files/report.html', './files/out.pdf')
    return report

  def server_info(self):
    return """<div class='server-info'>
        <div class='server-name'>#{server_name}</div>
        <div class='currentMap'>#{currentMap}</div>
    </div>"""

  def winner_info(self):
    res = "<div class='winner-info'>"
    res += "<span class='winner-label'>Winner: </span>"
    res += f"<span class='winner-name'>{self.winner_name}</span>"
    res += "</div>"
    return res

  def game_summary(self):
    output = "<div class='game-summary'>"
    output += f"<div><b class='server-name'>SC2 Version:</b> <span>{self.sc2replay.release_string}</span></div>"
    output += f"<div><b class='server-name'>Game type:</b> <span>{self.sc2replay.category}</span></div>"
    output += f"<div><b class='server-name'>Start time:</b> <span> {self.sc2replay.start_time}</span></div>"
    output += f"<div><b class='server-name'>Type:</b> <span> {self.sc2replay.type} on {self.sc2replay.map_name}</span></div>"
    output += f"<div><b class='server-name'>Length:</b> <span> {self.sc2replay.game_length}</span></div>"
    output += "<br>"
    for team in self.getTeams():
      output += f"<div class='server-name'>{team}</div>"
    output += "<br>"
    output += f"<div><b class='server-name'>Winner:</b> <span class='winner-name'> {self.winner_name}</span></div>"
    output += "</div>"
    return output

  def getTeams(self):
    teams = list()
    for team in self.sc2replay.teams:
      players = list()
      for player in team:
          players.append("({0}) {1}".format(player.pick_race[0], player.name))
      formattedPlayers = '\n         '.join(players)
      teams.append("Team {0}:  {1}".format(team.number, formattedPlayers))
    return teams

  def build_orders(self):
    report = "<div class='build_orders'>"
    for player in self.parsed_result['players'].values():
      if self.parsed_result['cooperative'] and not player['is_human']:
        continue
      report += self.build_order_table(player)
    report += '</div>'
    return report

  def build_order_table(self, player):
    fraction_title = "Spectators"
    if self.player_colors[player['name']] == 'red':
      fraction = "mason"
    elif self.player_colors[player['name']] == 'blue':
      fraction = 'agatha'

    # if fraction == "mason":
    #   fraction_title = "Mason Order"
    # elif fraction == "agatha":
    #   fraction_title = "Agatha Knights"
    # else:
    #   fraction_title = "Temp title"

    table = f"<div class='{fraction}-container fraction-container'>"
    table += f"<div class='title {fraction}'>{player['name']}</div>"
    table += f"<div class='singleBlock {fraction}'>"
    table += f"<table class='listitems2 {fraction}'>" + self.table_header() + self.table_body(player['buildOrder']) + "</table>"
    table += "</div>"
    table += "</div>"
    return table

  def table_header(self):
    th = """<thead style="display: table-row-group;">
      <th class='username'><div>Supply</div></th>
      <th class='score'><div>Time</div></th>
      <th class='kills'><div>Build</div></th>
    </thead>"""
    return th

  def table_body(self, build_order):
    body = ""
    for event in build_order:
      tr = ("<tr>"
        + "<td class='username'>"  + f"<div>{event['supply']}</div>" + "</td>"
        + "<td class='score'>" + f"<div>{event['time']}</div>" + "</td>"
        + "<td class='kills'>"+ f"<div>{event['name']}</div>" + "</td>"
        +"</tr>")
      body += tr
    body = "<tbody>" + body + "</tbody>"
    return body

  def generate_battles(self):
    result_replay = self.parsed_result
    # update player_names for units_lost dicts
    [lost_record.update({'pn': result_replay['players'][1]['name']}) for lost_record in result_replay['players'][1]['unitsLost']]
    [lost_record.update({'pn': result_replay['players'][2]['name']}) for lost_record in result_replay['players'][2]['unitsLost']]

    # concat all units_losts
    units_lost = [*result_replay['players'][1]['unitsLost'], *result_replay['players'][2]['unitsLost']]

    # sort units lost by chronological time
    units_lost.sort(key=lambda x:x['frame'])

    # split into battles
    prev_frame = frames_to_irl_seconds(units_lost[0]['frame'])
    self.battles = []
    current_battle = []

    total_len = len(units_lost)-1
    for index, ul in enumerate(units_lost):
      current_frame = frames_to_irl_seconds(ul['frame'])
      if current_frame - prev_frame > 20 or index == total_len:
        self.battles.append(current_battle)
        current_battle = []
      prev_frame = current_frame
      current_battle.append(ul)

  def export_battles(self):
    res = "<div class='battles'>"
    res += "<h3>Battles report</h3>"
    for index, bat in enumerate(self.battles):
      res += self.export_battle(index, bat)
    res += "</div>"
    return res

  def export_battle(self, index, bat):
    res = ""
    res += f"<div class='battle battle{index+1}'>"
    battle_duration = frames_to_irl_seconds(bat[-1]['frame'] - bat[0]['frame'])
    res += f"<div class='battle-time'>Time: {bat[0]['time']} - {bat[-1]['time']}</div><br/>"
    res += f"<div class='battle-duration'>Duration: {battle_duration}</div>"
    # res += "<h3>Units lost:</h3>"
    res += self.units_lost(bat)
    res += "</div><br/>"
    return res

  def  units_lost(self, bat):
    res = "<div class=units-lost>"
    sort_battle = sorted(bat, key=operator.itemgetter('pn'))
    for i,units in groupby(sort_battle, key=operator.itemgetter('pn')):
      # res += f"<span class='username'>{i}</span>"
      res += f"<h3 class='{self.player_colors[i]}'>{i}</h3>"
      sort_units = sorted(units, key=operator.itemgetter('name'))
      for i, subunits in groupby(sort_units, key=operator.itemgetter('name')):
        res += "<div class='unit-count'>"
        res += f"<span class='count-label'>{len(list(subunits))}</span>"
        res += self.get_unit_image(i)
        res += "</div>"
      res += "<hr class='battle-hr'>"
    res += "</div>"
    return res

  def get_unit_image(self, unit_name):
    res = ""
    img_name = self.filter_img_name(unit_name)
    if os.path.isfile(f"./icons76/{img_name}.jpg"):
      data_uri = base64.b64encode(open(f"./icons76/{img_name}.jpg", 'rb').read()).decode('utf-8')
      res += '<img class="unit-lost-img" src="data:image/jpg;base64,{0}">'.format(data_uri)
    else:
      res += unit_name
      print(img_name)
    return res

  def filter_img_name(self, name):
    img_name = name.lower().replace(" ", "")
    keys = ["reactor", "techlab", "widowmine", "supplydepot", "siegetank"]
    for k in keys:
      if k in img_name:
        img_name = k
        break
    return img_name

