      print(f"Time: {bat[0]['time']} - {bat[-1]['time']}")
      print(f"Duration: {battle_duration}")

      sort_battle = sorted(bat, key=operator.itemgetter('pn'))

      outputList={}
      for i,units in groupby(sort_battle, key=operator.itemgetter('pn')):
        print()
        print("Units lost for " + i + ":")
        print('---------------------------')
        sort_units = sorted(units, key=operator.itemgetter('name'))
        for i, subunits in groupby(sort_units, key=operator.itemgetter('name')):
          img_name = i.lower()
          if os.path.isfile(f"./icons/{img_name}.png"):
            data_uri = base64.b64encode(open(f"./icons/{img_name}.png", 'rb').read()).decode('utf-8')
            img_tag = '<img class="lost-unit-icon" src="data:image/png;base64,{0}">'.format(data_uri)
            imgs.append(img_tag)
          print(f"    {i} x {len(list(subunits))}")
      print("\n\n")

